The '''Apothecary''' runs the pharmacy and potion shop in south-west [[Varrock]]. He plays a part in certain quests, often making delicate potions and herbal products.

Free [[Potion|acne potions]] can be obtained from him about 50% of the time when talking to him.

During and after [[Shades of Mort'ton]], the [[Diary (Shades of Mort'ton)|diary of Herbi Flax]] found during the quest can be given to him, and in return he will grant the player 335 [[Herblore]] experience. This can only be done once.

==Treasure Trails==
*{{Anagram|The Apothecary|beginner|CARPET AHOY}}.
*{{CrypticNPC|The Apothecary|easy|Strength potions with red spiders' eggs? He is quite a herbalist.}}

